【roial】ロイアルのメンズパーカー☆<br>爽やかなハイビスカス柄がオシャレな、<br>ジップアップパーカーの登場です！<br>インパクト抜群のハイビスカス柄が◎<br>メインではもちろんインナーとして活躍する<br>おすすめアイテムです♪<br><br>■素材■<br>【本体】綿：54%　ポリエステル：40%　レーヨン：4%　ポリウレタン：2%<br>【リブ部分】綿：100%<br><br>■サイズ目安■<br>【Ｍ】着丈：68cm 身幅：51cm 肩幅：44cm 袖丈：62cm<br>【Ｌ】着丈：71cm 身幅：55cm 肩幅：47cm 袖丈：63cm<br><br>※モデルは身長175cmでMサイズを着用。

